import React from 'react';
import ReactDOM from 'react-dom';
import App from './App/App.js';
import './index.css';

class Website extends React.Component{
  render(){
      return(
        <div>
        <span><App></App></span>
        </div>
      )
    }
  }
ReactDOM.render(
    <Website />,
  document.getElementById('root')
);

